private String getDefaultQueueForPlanQueue(String queueName) {
  String planName = queueName.substring(queueName.lastIndexOf(".") + 1);
  queueName = queueName + "." + planName + ReservationConstants.DEFAULT_QUEUE_SUFFIX;
  return queueName;
}
